INSERT INTO `blogs` (`id`, `title`, `description`, `image`) VALUES
(6, 'ঢাকার বাহিরে বিভাগীয় শহরে ডেলিভারি এখন ৪৮ ঘণ্টায়!', 'চট্টগ্রাম,সিলেট,রাজশাহী,বরিশাল,খুলনা,রংপুর,ময়মনসিংহ। আপনার বুকিংকৃত পণ্য গ্রাহকের কাছে আরও দ্রুত পৌঁছে দিতে ইকুরিয়ার ঢাকার বাহিরে বিভাগীয় শহরে ডেলিভারি দিচ্ছে মাত্র ৪৮ ঘন্টায়। এখন ঢাকার বাহিরে পণ্য ডেলিভার করুন সবচেয়ে দ্রুত এবং নিরাপদে।', 'blogimg/140221_08_48_29.png'),
