(8, 'সকল লজিস্টিক সল্যুশন এখন এক জায়গায়', 'চট্টগ্রাম,সিলেট,রাজশাহী,বরিশাল,খুলনা,রংপুর,ময়মনসিংহ। আপনার বুকিংকৃত পণ্য গ্রাহকের কাছে আরও দ্রুত পৌঁছে দিতে ইকুরিয়ার ঢাকার বাহিরে বিভাগীয় শহরে ডেলিভারি দিচ্ছে মাত্র ৪৮ ঘন্টায়। এখন ঢাকার বাহিরে পণ্য ডেলিভার করুন সবচেয়ে দ্রুত এবং নিরাপদে।', 'blogimg/140221_08_32_30.png');
