INSERT INTO `mission` (`id`, `title`, `description`, `created_at`) VALUES
(1, 'আমাদের লক্ষ্য...', '<p><span style=\"color: rgb(28, 30, 33); font-family: Georgia, serif; font-size: 17px; white-space: pre-wrap;\">** আমাদের লক্ষ্য প্রযুক্তি ভিত্তিক সর্বোত্তম ডোরস্টেপ পরিষেবা প্রদান করা।</span><br style=\"color: rgb(28, 30, 33); font-family: Georgia, serif; font-size: 17px; white-space: pre-wrap;\"><span style=\"color: rgb(28, 30, 33); font-family: Georgia, serif; font-size: 17px; white-space: pre-wrap;\">** সারা দেশে থানা পর্যায়ে ডোরস্টেপ ডেলিভারী সার্ভিস প্রদান করা।</span><br style=\"color: rgb(28, 30, 33); font-family: Georgia, serif; font-size: 17px; white-space: pre-wrap;\"><span style=\"color: rgb(28, 30, 33); font-family: Georgia, serif; font-size: 17px; white-space: pre-wrap;\">** আগামী ১ বছরে ১০০০ মানুষের কর্মসংস্থানের ব্যবস্থা করা।</span><br style=\"color: rgb(28, 30, 33); font-family: Georgia, serif; font-size: 17px; white-space: pre-wrap;\"><span style=\"color: rgb(28, 30, 33); font-family: Georgia, serif; font-size: 17px; white-space: pre-wrap;\">** একটি শক্তিশালী ই-কমার্স প্লাটফর্ম তৈরী।</span><br style=\"color: rgb(28, 30, 33); font-family: Georgia, serif; font-size: 17px; white-space: pre-wrap;\"><span style=\"color: rgb(28, 30, 33); font-family: Georgia, serif; font-size: 17px; white-space: pre-wrap;\">** ডিজিটাল বাংলাদেশ বির্নিমানে অবদান রাখা।</span></p>', '2020-11-10 05:47:58');
