INSERT INTO `privacypolicy` (`id`, `title`, `description`, `created_at`) VALUES
(1, 'নিয়মাবলী...', '<p class=\"MsoNormal\" style=\"margin-bottom:8.0pt;text-align:justify;line-height:\r\nnormal\"><b><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\ncolor:#231F20\">Part I</span></b><b><span style=\"font-size:16.0pt;font-family:\r\n&quot;Times New Roman&quot;,&quot;serif&quot;\"><br>\r\n</span></b><b><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#231F20\">Subject and general\r\nterms</span></b><b><span style=\"font-size:16.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left: 0.5in; text-align: justify; text-indent: -0.25in; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if !supportLists]--><span style=\"font-size:9.0pt;font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\nmso-bidi-font-family:Wingdings;color:#231F20\">Ø<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp; </span></span><!--[endif]--><span style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#231F20\">These General terms of the contract between Delivmartand\r\nits end users set forward the terms and order of courier services schedules.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left: 0.5in; text-align: justify; text-indent: -0.25in; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if !supportLists]--><span style=\"font-size:9.0pt;font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\nmso-bidi-font-family:Wingdings;color:#231F20\">Ø<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp; </span></span><!--[endif]--><span style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#231F20\">These General terms are obligatory both for Delivmart\r\nand the user.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left: 0.5in; text-align: justify; text-indent: -0.25in; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if !supportLists]--><span style=\"font-size:9.0pt;font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\nmso-bidi-font-family:Wingdings;color:#231F20\">Ø<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp; </span></span><!--[endif]--><span style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#231F20\">The General terms are inseparable part of the\r\nindividual contract with the user.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left: 0.5in; text-align: justify; text-indent: -0.25in; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if !supportLists]--><span style=\"font-size:9.0pt;font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\nmso-bidi-font-family:Wingdings;color:#231F20\">Ø<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp; </span></span><!--[endif]--><span style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#231F20\">When a shipment is arrived, Delivmart accepts\r\non his behalf and on behalf of the user, associated with the shipment,these\r\nGeneral terms are in force with service-related individual.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:8.0pt;\r\nmargin-left:.5in;text-align:justify;line-height:107%\"><b><span style=\"font-size:12.0pt;line-height:107%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\ncolor:#231F20\">Part II</span></b><b><span style=\"font-size:9.0pt;line-height:\r\n107%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;color:#231F20\"><br>\r\n</span></b><b><span style=\"font-size:12.0pt;line-height:107%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#231F20\">Services range and\r\ncharacteristics</span></b><span style=\"font-size:9.0pt;line-height:107%;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;color:#231F20\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left: 0.5in; text-align: justify; text-indent: -0.25in; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if !supportLists]--><span style=\"font-size:9.0pt;font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\nmso-bidi-font-family:Wingdings;color:#231F20\">Ø<span s