INSERT INTO `tramsandcondition` (`id`, `title`, `description`, `created_at`) VALUES
(1, 'কাস্টমার শর্তবলী', '<p><br></p><p><span style=\"font-size: 24px;\"><span style=\"background-color: rgb(0, 255, 0);\"><br></span></span><span style=\"text-align: justify;\">&nbsp;একটি লজিস্টিকস কুরিয়ার সার্ভিস প্রোভাইডার প্রতিষ্ঠান।</span></p><p><span style=\"text-align: justify;\">বাংলাদেশ একটি দ্রুত বর্ধনশীল ও উন্নতশীল দেশ।</span></p><p><span style=\"text-align: justify;\">আমরা বিশ্বাস করি আমাদের দেশবাসীর সময় মুল্যবান।</span></p><p><span style=\"text-align: justify;\">তাই দেশবাসীর জীবনমানকে আরো সহজ, আরো উন্নত এবং ঝামেলা মুক্ত করতে আমরা অন ডিমান্ড হোম ডেলিভারি সার্ভিস ঢাকা সিটি সহ সারা বাংলাদেশে শুরু করেছি।</span></p><p><span style=\"text-align: justify;\">যার মাধ্যমে গ্রাহক ঘরে বসে অনলাইন পন্য, জরুরী পার্সেল,&nbsp; সুপার শপের পণ্য, রেস্টুরেন্টের খাবার, ঔষধসহ যেকোন ধরনের ক্রয়কৃত পণ্য ও প্রয়োজনীয় জিনিসপত্র অতিরিক্ত ব্যয় ছাড়া ডেলিভারি সেবা গ্রহণ করতে পারবেন।</span></p><p><span style=\"font-weight: bolder;\">আমাদের বৈশিষ্ট্য</span>&nbsp;ঃ</p><p><span style=\"text-align: justify;\">প্রযুক্তি আমাদের জীবনে এনে দিয়েছে গতি।</span></p><p><span style=\"text-align: justify;\">সেই প্রযুক্তিকে আরো গতিশীল করে</span><span style=\"text-align: justify; font-size: 1rem;\">&nbsp;সঠিক সময়ে উন্নতমানের হোম ডিলেভারি সেবা প্রদান করতে&nbsp;&nbsp;</span></p><p><span style=\"text-align: justify; font-size: 1rem;\"><br></span><br></p><p><span style=\"text-align: justify; font-size: 1rem;\">গ্রাহকের নিকট সর্বদা দ্রুত ও মানসম্মত সার্ভিস দিতে অঙ্গিকারাবদ্ধ।</span></p><p><span style=\"text-align: justify; font-size: 1rem;\">আমরা ঢাকা সিটিতে ২৪ ঘন্টায়র মধ্যে শুক্রবারসহ নিত্যদিনের প্রয়োজনীয় অর্ডারকৃত পণ্য ডেলিভারি সার্ভিস করে থাকি।</span></p><p><span style=\"text-align: justify; font-size: 1rem;\">কোয়ালিটি সার্ভিস এর জন্য আমাদের রয়েছে দক্ষ, সৎ ও বিশ্বস্ত ডেলিভারি এক্সিকিউটিভ।</span></p><p><span style=\"text-align: justify; font-size: 1rem;\">তাছাড়া দ্রুত আপনার ক্রয়কৃত পণ্য পৌঁছে দেওয়ার জন্য আমাদের রয়েছে সব ধরনের পরিবহন এবং সুসংগঠিত দক্ষ ম্যানেজমেন্ট টিম।</span></p><p><span style=\"font-weight: bolder; font-size: 1rem;\">আমাদের লক্ষ্যঃ</span></p><p><span style=\"font-size: 1rem;\">&nbsp;</span><span style=\"font-size: 1rem; text-align: justify;\">** আমাদের লক্ষ্য প্রযুক্তি ভিত্তিক সর্বোত্তম ডোরস্টেপ পরিষেবা প্রদান করা।</span></p><p><span style=\"font-size: 1rem; text-align: justify;\">** সারা দেশে জেলা পর্যায়ে ডোরস্টেপ</span></p><p><span style=\"font-size: 1rem; text-align: justify;\">পিক &amp; ডেলিভারী সার্ভিস প্রদান করা।</span></p><p><span style=\"font-size: 1rem; text-align: justify;\">** আগামী ১ বছরে ১০০০ মানুষের কর্মসংস্থানের ব্যবস্থা করা।</span></p><p><span style=\"font-size: 1rem; text-align: justify;\">** একটি শক্তিশালী ই-কমার্স প্লাটফর্ম তৈরী করা।</span></p><p><span style=\"font-size: 1rem; text-align: justify;\">** ডিজিটাল বাংলাদেশ বির্নিমানে শক্ত বদান রাখা।</span></p><p><span style=\"font-size: 1rem; text-align: justify;\">&nbsp;</span><span style=\"font-size: 1rem;\"></span><span style=\"font-weight: bolder; font-size: 1rem;\">আমাদের উদ্দেশ্য</span><span style=\"font-size: 1rem;\">&nbsp;ঃ</span></p><p><span style=\"font-size: 1rem;\">সম্মানিত মার্চেন্ট&nbsp;</span></p><p><span style=\"font-size: 1rem; text-align: justify;\">আমরা আপনার ব্যবসা বৃদ্ধি ফোকাস করছি,</span></p><p><span style=\"font-size: 1rem; text-align: justify;\">আমরা আপনার নিত্যদিনের কাস্টমারদের সময় বাঁচিয়ে ব্যবসায়িক সুসম্পর্ক বৃদ্ধি করার লক্ষ্যে হোম ডেলিভারি সার্ভিস প্রদান করছি।</span></p><p><span style=\"font-size: 1rem; text-align: justify;\">আমরা ঢাকা সিটির মধ্যে শুক্রবারসহ প্রতিদিনের অর্ডারকৃত পণ্য ২৪ ঘন্টার মধ্যে অন ডিমান্ড ডেলিভারি সার্ভিস করে থাকি।</span></p><p><span style=\"font-size: 1rem; text-align: justify;\">আমাদের রয়েছে দক্ষ, সৎ ও বিশ্বস্ত ডেলিভারি এক্সিকিউটিভ ও জরুরী সার্ভিস এর জন্য কাস্টমার সার্ভিস সেন্টার। তাছাড়া দ্রুত আপনার ক্রয়কৃত পণ্য ও পার্সেল পৌঁছে দেওয়ার জন্য রয়েছে আমাদের সব ধরনের পরিবহন এবং সুসংগঠিত দক্ষ ম্যানেজমেন্ট টিম।</span><span style=\"font-size: 1rem;\">&nbsp;</span></p><p><span style=\"font-size: 1rem;\"><br></span><span style=\"font-weight: bolder; font-size: 1rem;\">আমাদের উল্লেখযোগ্য সার্ভিস সমূহঃ</span><span style=\"font-size: 1rem;\">&nbsp;</span></p><p style=\"outline: 0px; vertical-align: baseline; background: 0px 0px rgb(249, 249, 249); margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; color: rgb(50, 49, 49); font-family: Lato, sans-serif; font-size: 17px;\"><span style=\"font-size: 1rem; text-align: justify; background-color: rgb(255, 255, 255); color: rgb(0, 0, 0); font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;;\">নিত্য প্রয়োজনীয় পণ্য, ডকুমেন্টস ও পার্সেল,লান্স বক্স, রেস্টুরেন্টের খাবার, ওষুধ, অনলাইন কেনাকাটা, লন্ড্রি, টেইলারিং, স্টেশনারি ও বুক, কেক, ফুল ও ফুল ইত্যাদি।</span>..........</p>', '2021-02-17 01:59:21');
