INSERT INTO `userguideline` (`id`, `title`, `description`, `youtube_link`, `img`, `created_at`) VALUES
(1, 'গ্রাহক গাইড লাইন', '<h3 style=\"box-sizing: inherit; margin-top: 0.2rem; margin-right: 0px; margin-left: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: &quot;Exo 2&quot;, sans-serif; line-height: 1.4; text-rendering: optimizelegibility; font-size: 1.5rem; text-align: justify;\"><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><br></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"font-size: 24px;\"><span style=\"background-color: rgb(0, 255, 0);\"><br></span></span><span style=\"text-align: justify;\">&nbsp;একটি লজিস্টিকস কুরিয়ার সার্ভিস প্রোভাইডার প্রতিষ্ঠান।</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"text-align: justify;\">বাংলাদেশ একটি দ্রুত বর্ধনশীল ও উন্নতশীল দেশ।</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"text-align: justify;\">আমরা বিশ্বাস করি আমাদের দেশবাসীর সময় মুল্যবান।</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"text-align: justify;\">তাই দেশবাসীর জীবনমানকে আরো সহজ, আরো উন্নত এবং ঝামেলা মুক্ত করতে আমরা অন ডিমান্ড হোম ডেলিভারি সার্ভিস ঢাকা সিটি সহ সারা বাংলাদেশে শুরু করেছি।</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"text-align: justify;\">যার মাধ্যমে গ্রাহক ঘরে বসে অনলাইন পন্য, জরুরী পার্সেল,&nbsp; সুপার শপের পণ্য, রেস্টুরেন্টের খাবার, ঔষধসহ যেকোন ধরনের ক্রয়কৃত পণ্য ও প্রয়োজনীয় জিনিসপত্র অতিরিক্ত ব্যয় ছাড়া ডেলিভারি সেবা গ্রহণ করতে পারবেন।</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"font-weight: bolder;\">আমাদের বৈশিষ্ট্য</span>&nbsp;ঃ</p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"text-align: justify;\">প্রযুক্তি আমাদের জীবনে এনে দিয়েছে গতি।</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"text-align: justify;\">সেই প্রযুক্তিকে আরো গতিশীল করে</span><span style=\"text-align: justify; font-size: 1rem;\">&nbsp;সঠিক সময়ে উন্নতমানের হোম ডিলেভারি সেবা প্রদান করতে&nbsp;&nbsp;</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"text-align: justify; font-size: 1rem;\"><br></span><br></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"text-align: justify; font-size: 1rem;\">গ্রাহকের নিকট সর্বদা দ্রুত ও মানসম্মত সার্ভিস দিতে অঙ্গিকারাবদ্ধ।</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"text-align: justify; font-size: 1rem;\">আমরা ঢাকা সিটিতে ২৪ ঘন্টায়র মধ্যে শুক্রবারসহ নিত্যদিনের প্রয়োজনীয় অর্ডারকৃত পণ্য ডেলিভারি সার্ভিস করে থাকি।</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"text-align: justify; font-size: 1rem;\">কোয়ালিটি সার্ভিস এর জন্য আমাদের রয়েছে দক্ষ, সৎ ও বিশ্বস্ত ডেলিভারি এক্সিকিউটিভ।</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"text-align: justify; font-size: 1rem;\">তাছাড়া দ্রুত আপনার ক্রয়কৃত পণ্য পৌঁছে দেওয়ার জন্য আমাদের রয়েছে সব ধরনের পরিবহন এবং সুসংগঠিত দক্ষ ম্যানেজমেন্ট টিম।</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"font-weight: bolder; font-size: 1rem;\">আমাদের লক্ষ্যঃ</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"font-size: 1rem;\">&nbsp;</span><span style=\"font-size: 1rem; text-align: justify;\">** আমাদের লক্ষ্য প্রযুক্তি ভিত্তিক সর্বোত্তম ডোরস্টেপ পরিষেবা প্রদান করা।</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"font-size: 1rem; text-align: justify;\">** সারা দেশে জেলা পর্যায়ে ডোরস্টেপ</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"font-size: 1rem; text-align: justify;\">পিক &amp; ডেলিভারী সার্ভিস প্রদান করা।</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"font-size: 1rem; text-align: justify;\">** আগামী ১ বছরে ১০০০ মানুষের কর্মসংস্থানের ব্যবস্থা করা।</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"font-size: 1rem; text-align: justify;\">** একটি শক্তিশালী ই-কমার্স প্লাটফর্ম তৈরী করা।</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"font-size: 1rem; text-align: justify;\">** ডিজিটাল বাংলাদেশ বির্নিমানে শক্ত বদান রাখা।</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"font-size: 1rem; text-align: justify;\">&nbsp;</span><span style=\"font-size: 1rem;\"></span><span style=\"font-weight: bolder; font-size: 1rem;\">আমাদের উদ্দেশ্য</span><span style=\"font-size: 1rem;\">&nbsp;ঃ</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"font-size: 1rem;\">সম্মানিত মার্চেন্ট&nbsp;</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"font-size: 1rem; text-align: justify;\">আমরা আপনার ব্যবসা বৃদ্ধি ফোকাস করছি,</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"font-size: 1rem; text-align: justify;\">আমরা আপনার নিত্যদিনের কাস্টমারদের সময় বাঁচিয়ে ব্যবসায়িক সুসম্পর্ক বৃদ্ধি করার লক্ষ্যে হোম ডেলিভারি সার্ভিস প্রদান করছি।</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"font-size: 1rem; text-align: justify;\">আমরা ঢাকা সিটির মধ্যে শুক্রবারসহ প্রতিদিনের অর্ডারকৃত পণ্য ২৪ ঘন্টার মধ্যে অন ডিমান্ড ডেলিভারি সার্ভিস করে থাকি।</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"font-size: 1rem; text-align: justify;\">আমাদের রয়েছে দক্ষ, সৎ ও বিশ্বস্ত ডেলিভারি এক্সিকিউটিভ ও জরুরী সার্ভিস এর জন্য কাস্টমার সার্ভিস সেন্টার। তাছাড়া দ্রুত আপনার ক্রয়কৃত পণ্য ও পার্সেল পৌঁছে দেওয়ার জন্য রয়েছে আমাদের সব ধরনের পরিবহন এবং সুসংগঠিত দক্ষ ম্যানেজমেন্ট টিম।</span><span style=\"font-size: 1rem;\">&nbsp;</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"font-size: 1rem;\"><br></span><span style=\"font-weight: bolder; font-size: 1rem;\">আমাদের উল্লেখযোগ্য সার্ভিস সমূহঃ</span><span style=\"font-size: 1rem;\">&nbsp;</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; text-align: left;\"><span style=\"font-size: 1rem; text-align: justify;\">নিত্য প্রয়োজনীয় পণ্য, ডকুমেন্টস ও পার্সেল,লান্স বক্স, রেস্টুরেন্টের খাবার, ওষুধ, অনলাইন কেনাকাটা, লন্ড্রি, টেইলারিং, স্টেশনারি ও বুক, কেক, ফুল ও ফুল ইত্যাদি।</span></p></h3><ul style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 1.1rem; padding: 0px; font-family: &quot;Titillium Web&quot;, sans-serif; font-size: 14px; line-height: 1.375rem; list-style-position: initial; list-style-image: initial; text-align: justify;\"></ul>', NULL, 'no', '2021-02-19 08:12:12');
INSERT INTO `vission` (`id`, `title`, `description`, `created_at`) VALUES
(1, 'আমাদের বৈশিষ্ট্য...', '<h6 style=\"text-align: justify; \"><span style=\"font-family: &quot;Source Sans Pro&quot;;\">﻿</span><span style=\"font-family: &quot;Source Sans Pro&quot;;\">প্রযুক্তি আমাদের জীবনে এনে দিয়েছে গতি। সেই প্রযুক্তিকে কাজে লাগিয়ে এভ্রিথিং এট ইউর ডোরস্টেপ এই স্লোগান নিয়ে সঠিক সময়ে উন্নতমানের হোম ডিলেভারি সেবা প্রদান করতে </span></h6><h6 style=\"text-align: justify; \"><span style=\"font-family: &quot;Source Sans Pro&quot;;\">ফিক্সড কুয়ার&nbsp;</span>ডেলিভারি সার্ভিস গ্রহকের নিকট অঙ্গিকারাবদ্ধ। আমরা ঢাকা সিটির ভিতর ২৪ ঘন্টায়র মধ্যে শুক্রবারসহ নিত্যদিনের প্রয়োজনীয় অর্ডারকৃত পণ্য ডেলিভারি সার্ভিস করে থাকি। কোয়ালিটি সার্ভিস এর জন্য আমাদের রয়েছে দক্ষ, সৎ ও বিশ্বস্ত ডেলিভারি এক্সিকিউটিভ। তাছাড়া দ্রুত আপনার ক্রয়কৃত পণ্য পৌঁছে দেওয়ার জন্য আমাদের রয়েছে সব ধরনের পরিবহন&nbsp; এবং সুসংগঠিত দক্ষ ম্যানেজমেন্ট টিম।<span style=\"color: inherit; font-size: 1rem; font-family: &quot;Source Sans Pro&quot;;\">﻿</span><span style=\"color: inherit; font-size: 1rem; font-family: &quot;Source Sans Pro&quot;;\">﻿</span><span style=\"color: inherit; font-size: 1rem; font-family: &quot;Source Sans Pro&quot;;\">﻿</span></h6>', '2020-11-10 06:06:15');
