INSERT INTO `welcomemsg` (`id`, `title`, `description`, `created_at`) VALUES
(1, 'welcome', '<p><span style=\"text-align: justify; font-size: 1rem;\">একটি লজিস্টিকস কুরিয়ার সার্ভিস প্রোভাইডার প্রতিষ্ঠান।</span></p><p><span style=\"text-align: justify;\">বাংলাদেশ একটি দ্রুত বর্ধনশীল ও উন্নতশীল দেশ।</span></p><p><span style=\"text-align: justify;\">আমরা বিশ্বাস করি আমাদের দেশবাসীর সময় মুল্যবান।</span></p><p><span style=\"text-align: justify;\">তাই দেশবাসীর জীবনমানকে আরো সহজ, আরো উন্নত এবং ঝামেলা মুক্ত করতে আমরা অন ডিমান্ড হোম ডেলিভারি সার্ভিস ঢাকা সিটি সহ সারা বাংলাদেশে শুরু করেছি।</span></p><p><span style=\"text-align: justify;\">যার মাধ্যমে গ্রাহক ঘরে বসে অনলাইন পন্য, জরুরী পার্সেল,&nbsp; সুপার শপের পণ্য, রেস্টুরেন্টের খাবার, ঔষধসহ যেকোন ধরনের ক্রয়কৃত পণ্য ও প্রয়োজনীয় জিনিসপত্র অতিরিক্ত ব্যয় ছাড়া ডেলিভারি সেবা গ্রহণ করতে পারবেন।</span></p>', '2021-02-20 09:45:39');
